import React, { Component } from "react";
import "./assets/style.css";
import axios from 'axios';
import {Table } from 'react-bootstrap';
import Nav from 'react-bootstrap/Nav';

class Profil extends Component {

  constructor(props){
    super(props);
    this.state = {
        posts:[]
    }

  }

      componentDidMount() {
        axios.get('http://localhost:6200/profile',{headers : {"auth-token": "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..tZu0FCP_5lM0fy746JhZS4wcMz8AZw17bFQ-ndzG19E"}})
        .then(response=>{
          console.log(response)
        })
       .catch(error =>{
       console.log(error)
        })
      }

    render(){
      const { posts}=this.state
      const divStyle = {

       height :'100px',
      }
      return (
          <div className="wrapper">
               <div className="f-wrapper"> 
               <h2>Profil utilisateur</h2>
               {
               posts.length ?
               posts.map(post=> <ul key={post.id}>  
              <li>Name = {post.username}</li>
              <li>Email = {post.mail}</li>
              <li>¼ de concombre, coupé grossièrement</li>
              <li>1 petite tomate, coupée</li>
              </ul>):
            null
               }

                    <Table striped bordered hover size="sm">
                        <thead>
                            <tr>

                            <th>Name</th>
                            <th>Current Price </th>
                            <th>Opening Price</th>
                            <th>Lowest Price of the day</th>
                            <th>Highest Price of the day</th>
                            <th>Image</th>
                            <th>Period</th>
                            </tr>
                        </thead>
                        <tbody>
                        {
                        posts.length ?

                            posts.map(post=> <tr key={post.id}>

                            <td>{post.Cryptommonaie}</td>
                            <td>{post.Prix}</td>
                            <td>{post["Prix à l'Ouverture"]} </td>
                            <td>{post["Prix le plus bas"]}</td>
                            <td>{post["Prix le plus Haut"]}</td>
                            <td><img src={post.URL}alt="..." style={ divStyle}/></td>
                            <td>
                             </td>
                            </tr>):
                            null
                            }


                        </tbody>
                    </Table>
                </div>
           </div>

       )
       }}
 export default Profil;
